	*lp_yy_c_buf_p = '\0';	/* preserve lp_yytext */
	lp_yy_hold_char = *++lp_yy_c_buf_p;

	lp_yy_current_buffer->lp_yy_at_bol = (c == '\n');
	if ( lp_yy_current_buffer->lp_yy_at_bol )
		++lp_yylineno;

